import { useState } from "react";
import "./styles/tasks.css";
import Categories from "./Categories";
function Tasks({ handleInput }) {
  return (
    <div className="tasks">
      <h1>Tasks</h1>
      <input
        type="text"
        onChange={handleInput}
        placeholder={`Add new task inside ${Categories} category`}
      />
      {}
    </div>
  );
}

export default Tasks;
